import classes from "./Product.module.css";

const Product = (props) => {
  return (
    <div className={classes.container}>
      <div className={classes.upper}>
        <div>상품 ID</div>
        <div>{props.id}</div>
      </div>
      <div className={classes.lower}>
        {props.prd["title"] && (
          <div className={classes.item}>
            <div className={classes.key}>상품명</div>
            <div className={classes.value}>{props.prd["title"]}</div>
          </div>
        )}
        {props.prd["url"] && (
          <div className={classes.item}>
            <div className={classes.key}>URL</div>
            <div className={classes.value}>{props.prd["url"]}</div>
          </div>
        )}
        {props.prd["price"] && (
          <div className={classes.item}>
            <div className={classes.key}>가격</div>
            <div className={classes.value}>{props.prd["price"]}</div>
          </div>
        )}
        {props.prd["stock"] && (
          <div className={classes.item}>
            <div className={classes.key}>품절상태</div>
            <div className={classes.value}>{props.prd["stock"]}</div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Product;
